import React from 'react'
import {Link} from 'react-router-dom'

function Navbar() {
  return (
    <div>
        <Link to='/'>Homepage</Link>
        <link to='/detail'>Product Detail</link>
        <Link to='cart'>Cart</Link>
    </div>
  )
}

export default Navbar
